import pytest
from unittest.mock import patch, MagicMock
from PIL import UnidentifiedImageError
import base64
from ObjectDetectionModel import ObjectDetectionModel, predict_raw, health


VALID_BASE64_IMAGE = ""

@pytest.fixture
def model_instance():
    """Fixture to provide a fresh instance of ObjectDetectionModel."""
    with patch("transformers.AutoModelForObjectDetection.from_pretrained") as mock_model, \
         patch("transformers.AutoImageProcessor.from_pretrained") as mock_processor:
        
        mock_model.return_value = MagicMock()
        mock_processor.return_value = MagicMock()
        instance = ObjectDetectionModel()
        yield instance

def test_model_loading_success(model_instance):
    """Test if the model loads successfully."""
    assert model_instance.model_loaded is True

def test_predict_raw_valid_image(model_instance):
    """Test predict_raw function with a valid image."""
    # Patch the model instance's predict method to return a controlled result
    with patch.object(model_instance, 'predict', return_value={"predictions": [{"class": "person", "score": 0.95, "box": [10, 20, 30, 40]}]}):
        input_data = {
            "data": {
                "ndarray": [{"image_bytes": VALID_BASE64_IMAGE}]
            },
            "parameters": {"threshold": 0.5}
        }
        result = predict_raw(input_data)
        assert "predictions" in result
        assert result["predictions"][0]["class"] == "person"

def test_predict_invalid_image(model_instance):
    """Test the predict_raw function with an invalid image."""
    with patch.object(model_instance, 'predict', return_value={"error": "Invalid image file"}):
        input_data = {
            "data": {
                "ndarray": [{"image_bytes": base64.b64encode(b"invalid image data").decode()}]
            },
            "parameters": {"threshold": 0.5}
        }
        result = predict_raw(input_data)
        assert "error" in result
        assert result["error"] == "Invalid image file"

def test_health_check_success(model_instance):
    """Test if the health check passes when the model is loaded."""
    health_status = model_instance.health_status()
    assert health_status["status"] == "OK"
    assert health_status["message"] == "Model is loaded"
